import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import ReservationStepOne from './pages/ReservationStepOne';
import ReservationStepTwo from './pages/ReservationStepTwo';
import ReservationSuccess from './pages/ReservationSuccess';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<ReservationStepOne />} />
        <Route path="/step-two" element={<ReservationStepTwo />} />
        <Route path="/success" element={<ReservationSuccess />} />
      </Routes>
    </Router>
  );
}

export default App;
